'use client';

import * as React from 'react';
import Image from 'next/image';

const defaultLogoDataUri = "data:image/png;base64,---QAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+IQAACEA+I-."

export function Logo() {
  const [logoSrc, setLogoSrc] = React.useState<string | null>(null);
  const [isLoading, setIsLoading] = React.useState(true);

  React.useEffect(() => {
    try {
      const savedLogo = localStorage.getItem('custom-logo');
      if (savedLogo) {
        setLogoSrc(savedLogo);
      }
    } catch (error) {
      console.error("Could not access local storage for logo", error);
    }
    setIsLoading(false);
  }, []);

  if (isLoading) {
    // Render a skeleton placeholder to prevent layout shift while loading from localStorage.
    return (
      <div className="flex items-center gap-2" aria-label="Loading logo...">
        <div className="w-[160px] h-[70px] bg-muted animate-pulse rounded-md" />
      </div>
    );
  }
  
  const effectiveLogoSrc = logoSrc || defaultLogoDataUri;

  return (
    <div className="flex items-center gap-2">
      <Image 
          src={effectiveLogoSrc} 
          alt="Bagmati Dental Clinic Logo" 
          width={299} 
          height={79} 
          className="h-auto w-[160px] object-contain" 
          priority 
        />
    </div>
  );
}
